import logo from './logo.svg';
import './App.css';

class App extends Component {
  constructor() {
    super();
    this.state = {
      friends: [
        {
          name: 'trash1',
        },
        {
          name: 'trash2',
        },
        {
          name: 'trash3',
        },
      ],
    };
  }
  render() {
    return <div className="App"></div>;
  }
}

export default App;
